INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (472, '0133128911', '9780133128918', 'Basics of Web Design: HTML5 & CSS3', 2014, 27, 3, 1, 3, '8\" x 10\"', '400', '2013-01-18 00:00:00', 'Intended for use in a beginning web design or web development course\n \nThe Basics of Web Design: HTML5 & CSS3, 2e takes a unique approach to prepare students to design web pages that work today in addition to being ready to take advantage of HTML5 coding techniques of the future. The text covers the basic concepts that web designers need to develop their skills:\nIntroductory Internet and Web concepts\nCreating web pages with HTML5\nConfiguring text, color, and page layout with Cascading Style Sheets\nConfiguring images and multimedia on web pages\nWeb design best practices\nAccessibility, usability, and search engine optimization considerations\nObtaining a domain name and web host\nPublishing to the Web\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (473, '0133068307', '9780133068306', 'Introduction to JavaScript Programming with XML and PHP', 2014, 27, 3, 1, 3, '8\" x 10\"', '864', '2013-02-14 00:00:00', 'For a one-semester JavaScript programming course for students who have knowledge of HTML and CSS\n \nIntroduction to JavaScript Programming with XML and PHP is an introductory textbook on JavaScript designed for students in Web Development programs at career-focused 2- and 4-year schools that have taken a course in HTML. This hands-on book focuses on the \"how-to\" aspects of JavaScript for beginning students, with a focus on enhancing and extending websites.  \n \nTeaching and Learning Experience', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (474, '013336092X', '9780133360929', 'Starting Out with C++: Early Objects', 2014, 23, 3, 1, 3, '8\" x 10\"', '1,200', '2013-02-20 00:00:00', 'Tony Gaddis’s accessible, step-by-step presentation helps beginning students understand the important details necessary to become skilled programmers at an introductory level. Gaddis motivates the study of both programming skills and the C++ programming language by presenting all the details needed to understand the “how” and the “why”—but never losing sight of the fact that most beginners struggle with this material. His approach is both gradual and highly accessible, ensuring that students understand the logic behind developing high-quality programs.\n\nIn Starting Out with C++: Early Objects, Gaddis covers objects and classes early after functions and before arrays and pointers. As with all Gaddis texts, clear and easy-to-read code listings, concise and practical real-world examples, and an abundance of exercises appear in every chapter. This text is intended for either a one-semester accelerated introductory course or a traditional two-semester sequence covering C++ programming.\n\nNEW! This edition is available with MyProgrammingLab, an innovative online homework and assessment tool. Through the power of practice and immediate personalized feedback, MyProgrammingLab helps students fully grasp the logic, semantics, and syntax of programming.\n\nNote: If you are purchasing the standalone text or electronic version, MyProgrammingLab does not come automatically packaged with the text. To purchase MyProgrammingLab, please visit: myprogramminglab.com or you can purchase a package of the physical text + MyProgrammingLab by searching the Pearson Higher Education web site. MyProgrammingLab is not a self-paced technology and should only be purchased when required by an instructor.\n\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (475, '0133250121', '9780133250121', 'Java Software Structures', 2014, 26, 3, 1, 3, '7-3/8\" x 9-1/8\"', '648', '2013-02-25 00:00:00', 'Intended for use in the Java Data Structures course\n \nThe fourth edition of Java Software Structures embraces the enhancements of the latest version of Java, where all structures and collections are based on generics. The framework of the text walks the reader through three main areas: conceptualization, explanation, and implementation, allowing for a consistent and coherent introduction to data structures. Students learn how to develop high-quality software systems using well-designed collections and algorithms.\n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience, for both instructors and students, this program will:\nApply Theory and/or Research: Three main areas: conceptualization, explanation, and implementation, allow for a consistent and coherent introduction to data structures.\nEngage Students: Hands-on optional case studies and new VideoNotes tutorials offer real-world perspective, and keep students interested in the material.\nSupport Instructors and Students: Instructor Supplemental Support includes PowerPoint presentation slides, Solution Manual, test bank, case studies with source code, and solutions.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (476, '0133360903', '9780133360905', 'Building Java Programs', 2014, 23, 3, 1, 3, '7-3/8\" x 9-1/8\"', '1,176', '2013-02-25 00:00:00', 'Building Java Programs: A Back to Basics Approach, Third Edition, introduces novice programmers to basic constructs and common pitfalls by emphasizing the essentials of procedural programming, problem solving, and algorithmic reasoning. By using objects early to solve interesting problems and defining objects later in the course, Building Java Programs develops programming knowledge for a broad audience.\n\nNEW! This edition is available with MyProgrammingLab, an innovative online homework and assessment tool. Through the power of practice and immediate personalized feedback, MyProgrammingLab helps students fully grasp the logic, semantics, and syntax of programming.\n\nNote: If you are purchasing the standalone text or electronic version, MyProgrammingLab does not come automatically packaged with the text. To purchase MyProgrammingLab, please visit: myprogramminglab.com or you can purchase a package of the physical text + MyProgrammingLab by searching the Pearson Higher Education web site. MyProgrammingLab is not a self-paced technology and should only be purchased when required by an instructor.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (477, '0133128083', '9780133128086', 'Starting Out With Visual Basic', 2014, 23, 3, 1, 3, '8-1/2\" x 10-7/8\"', '896', '2013-03-11 00:00:00', 'In Starting Out with Visual Basic 2012, Tony Gaddis and Kip Irvine take a step-by-step approach, helping students understand the logic behind developing quality programs while introducing the Visual Basic language. Fully-updated throughout, the 2012 edition also includes an extensive set of VideoNotes, including walk-throughs of many of the in-chapter tutorials. Each new student edition comes with a Visual Studio 2012 Express software package.\n\nNEW! This edition is available with MyProgrammingLab, an innovative online homework and assessment tool. Through the power of practice and immediate personalized feedback, MyProgrammingLab helps students fully grasp the logic, semantics, and syntax of programming.\n\nNote: If you are purchasing the standalone text or electronic version, MyProgrammingLab does not come automatically packaged with the text. To purchase MyProgrammingLab, please visit: myprogramminglab.com or you can purchase a package of the physical text + MyProgrammingLab by searching the Pearson Higher Education web site. MyProgrammingLab is not a self-paced technology and should only be purchased when required by an instructor.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (478, '0133129454', '9780133129458', 'Starting out with Visual C# 2012 (with CD-Rom)', 2014, 23, 3, 4, 3, '8-1/2\" x 10-7/8\"', '792', '2013-03-29 00:00:00', ' Intended for use in the Introductory C# Programming course\n \nTony Gaddis’s accessible, step-by-step presentation helps beginning students understand the important details necessary to become skilled programmers at an introductory level. Gaddis motivates the study of both programming skills and the Visual C# programming language by presenting all the details needed to understand the “how” and the “why”—but never losing sight of the fact that most beginners struggle with this material. His approach is both gradual and highly accessible, ensuring that students understand the logic behind developing high-quality programs.\n\nIn Starting Out With Visual C# 2012, Gaddis makes a very detailed and evenly paced presentation of both programming and C# syntax concepts so all readers will be able to follow along. His GUI-based approach to teaching C# will resonate with students in CS, IT, and CIS courses.\n \nTeaching and Learning Experience\nThis program will provide a better teaching and learning experience, for both instructors and students. Here’s how:\nGaddis’s Accessible, Step-by-Step Approach: Gaddis makes a very detailed and evenly paced presentation of both programming and C# syntax concepts so all readers will be able to follow along.\nEngaged Students: Gaddis’s GUI-based visual approach and entertaining program examples will capture—and keep— students’ interest.\nSupport Instructors and Students: Easy-to-read code, practice problems, and streamlined design help facilitate learning.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (479, '0321836960', '9780321836960', 'Elementary Statistics', 2014, 3, 5, 1, 2, '8-1/2\" x 10-7/8\"', '912', '2012-12-21 00:00:00', 'From SAT scores to job search methods, statistics influences and shapes the world around us. Marty Triola’s text continues to be the bestseller because it helps students understand the relationship between statistics and the world, bringing life to the theory and methods.\n \nElementary Statistics raises the bar with every edition by incorporating an unprecedented amount of real and interesting data that will help instructors connect with students today, and help them connect statistics to their daily lives. The Twelfth Edition contains more than 1,800 exercises, 89% of which use real data and 85% of which are new. Hundreds of examples are included, 91% of which use real data and 84% of which are new. New coverage of Ethics in Statistics highlights new guidelines that have been established in industry.\n \nThe accompanying MyStatLab™ online course provides users with countless opportunities to practice, plus learning tools that enhance their experience and comprehension. Instructions and displays for StatCrunch®, Pearson’s powerful online statistical software, are now integrated into the text as well as the MyStatLab course.\n \nElementary Statistics is part of a series that also includes an Essentials version as well as technology-specific texts, Elementary Statistics Using the TI 83/84 Calculator and Elementary Statistics Using Excel. Data sets and other resources for this series are available at our website.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (480, '032183870X', '9780321838704', 'Fundamentals of Statistics', 2014, 3, 5, 1, 3, '8-1/2\" x 10-7/8\"', '600', '2012-12-21 00:00:00', 'Ideal for a one-semester course in introductory statistics, this text is a streamlined version of Mike Sullivan’s Statistics: Informed Decisions Using Data, Fourth Edition.\n \nFrom Mike’s Classroom to Yours\n \nDrawing upon his passion for statistics and teaching, Mike Sullivan addresses the needs of today’s students, the challenges teachers face, and changes in the statistics community.  With feedback from his own students and classroom experience, Fundamentals of Statistics provides the tools to help students learn better and think statistically in a concise, friendly presentation. In addition, Mike’s contributions to the supplements and technology program make it easier to teach a multi-dimensional, engaging course.\n \nFor the Fourth Edition, active learning is easy to integrate with a supplemental Student Activity Workbook that is available along with accompanying instructor notes. The text also takes advantage of the latest statistical software, so students can focus on building conceptual understanding rather than memorizing formulas. A new example structure offers a bridge between by-hand solutions and the use of technology, and updated technology support appears in each chapter. All resources–including the Author in the Classroom videos that respond to student questions, and his national survey data in StatCrunch–were created for Mike’s classroom and are available for use in yours, to help students succeed and stay engaged.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (481, '0321836995', '9780321836991', 'Mathematics All Around', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '736', '2012-12-21 00:00:00', 'Students who enter a liberal arts math course often come with a fear of math, or they may struggle with topics during the course. Pirnot’s Mathematics All Around offers the supportive and clear writing style that students need to develop their math skills. By helping to reduce students’ math anxiety, Pirnot helps students to understand the use of math in the world around them. Students appreciate that the author’s approach is like the help they would receive during their own instructors’ office hours.\n \nThe Fifth Edition increases the text’s emphasis on developing problem-solving skills with additional support in the text and new problem-solving questions in MyMathLab. Quantitative reasoning is brought to the forefront with new Between the Numbers features and related exercises. Since practice is the key to success in this course, exercise sets are updated and expanded. MyMathLab offers additional exercise coverage plus new question types for problem-solving, vocabulary, reading comprehension, and more.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (482, '032182573X', '9780321825735', 'Excursions in Modern Mathematics', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '710', '2012-12-21 00:00:00', 'Excursions in Modern Mathematics introduces non-math majors to the power of math by exploring applications like social choice and management science, showing that math is more than a set of formulas. Ideal for an applied liberal arts math course, Tannenbaum’s text is known for its clear, accessible writing style and its unique exercise sets that build in complexity from basic to more challenging.\n \nThe Eighth Edition offers more real data and applications to connect with today’s students, expanded coverage of applications like growth, and revised exercise sets. MyMathLab exercise sets are expanded and the new Ready To Go MyMathLab course makes course set-up even easier.\n \n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (483, '0321825721', '9780321825728', 'Mathematics for Elementary Teachers with Activity Manual', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '1,200', '2012-12-21 00:00:00', 'An inquiry-based approach to this course allows future teachers to learn through exploration and group work, leading to a deeper understanding of mathematics. Known for her contributions in math education, Sybilla Beckmann writes the leading text for the inquiry approach—in Mathematics for Elementary Teachers with Activities, students engage, explore, discuss, and ultimately reach a true understanding of mathematics.\n \nThe Fourth Edition provides a new full-color design, making the math come alive. For the first time, the content and activities are combined into the same text, creating a self-contained resource for this course and beyond. Common Core State Standards are integrated to complement the National Council of Teachers of Mathematics (NCTM) Focal Points and Standards that appear where appropriate. New From the Field features highlight the latest research, Integrating Mathematics and Pedagogy (IMAP) videos, children’s literature, views from the classroom, and lesson planning to prepare future teachers for their teaching careers.\n \nMyMathLab® is available for the first time with exercises that review the key math skills relevant for each chapter, helping students to prepare for the activities and group work within the text itself. In addition, MyMathLab offers learning tools and resources for future teachers, including the full eText, Integrating Mathematics and Pedagogy (IMAP) videos, eManipulatives, and more.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (484, '032179477X', '9780321794772', 'A First Course in Probability', 2014, 3, 5, 1, 2, '8\" x 10\"', '552', '2012-12-21 00:00:00', 'A First Course in Probability, Ninth Edition, features clear and intuitive explanations of the mathematics of probability theory, outstanding problem sets, and a variety of diverse examples and applications. This book is ideal for an upper-level undergraduate or graduate level introduction to probability for math, science, engineering and business students. It assumes a background in elementary calculus.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (485, '0321880153', '9780321880154', 'Elementary Algebra', 2014, 11, 5, 1, 2, '8-1/2\" x 11\"', '720', '2012-12-21 00:00:00', 'The Sullivan/Struve/Mazzarella Algebra program is designed to motivate students to “do the math”— at home or in the lab—through a full suite of resources that support a variety of learning environments. Instructors can choose the ideal combination of resources for their students:\nThe text is known for its two-column example format that provides annotations to the left of the algebra. These annotations explain what the authors are about to do in each step (instead of what was just done), just as an instructor would do.\nTwo MyMathLab® course options are now available: a standard course and a Ready to Go course. The Ready to Go option provides premade assignments for every section of the text.\nNEW! The Video Notebook is an unbound, three-hole punched workbook/note-taking guide that asks students to write down important definitions and procedures and work through key examples as they watch the “Author in Action” videos.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (486, '0321880129', '9780321880123', 'Intermediate Algebra', 2014, 11, 5, 1, 2, '8-1/2\" x 11\"', '900', '2012-12-21 00:00:00', 'The Sullivan/Struve/Mazzarella Algebra program is designed to motivate students to “do the math”— at home or in the lab—through a full suite of resources that support a variety of learning environments. Instructors can choose the ideal combination of resources for their students:\nThe text is known for its two-column example format that provides annotations to the left of the algebra. These annotations explain what the authors are about to do in each step (instead of what was just done), just as an instructor would do.\nTwo MyMathLab® course options are now available: a standard course and a Ready to Go course. The Ready to Go option provides premade assignments for every section of the text.\nNEW! The Video Notebook is an unbound, three-hole punched workbook/note-taking guide that asks students to write down important definitions and procedures and work through key examples as they watch the “Author in Action” videos.\n ', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (487, '0321838696', '9780321838698', 'Business Statistics: A First Course', 2014, 22, 5, 1, 2, '8-1/2\" x 10-7/8\"', '864', '2012-12-21 00:00:00', 'his book is ideal for a one-semester course in business statistics, offering a streamlined presentation of Business Statistics, by Sharpe, De Veaux, and Velleman.\n                                                                                                                             \nBetter Decisions, Better Results.\n \nIn Business Statistics: A First Course, the authors leverage their unique blend of teaching, consulting, and entrepreneurial experiences to bring a modern business edge and dynamic approach to teaching statistics to business students. Focusing on statistics in the context of real business issues, the text emphasizes analysis and understanding over computation. This approach helps students be analytical, preparing them to make better business decisions and effectively communicate results. The authors have an accessible and compelling writing style and use short, targeted chapters to build understanding of new topics. They integrate current business applications to capture students’ attention and teach statistical concepts needed in the modern business world.\n \nThe Second Edition provides a wealth of examples and exercises so that the story is always tied to the way statistics is used to make better business decisions. New to this edition are For Examples (illustrative examples), Section Exercises (single-concept exercises), and part-ending Case Studies (which are more in-depth than the Brief Cases located at the end of chapters). To help students become proficient with technology, the Second Edition includes instructions for JMP®, Minitab®, and SPSS®, as well as new and expanded coverage of Excel® 2010 and the add-in XLSTAT™ for Pearson. Screenshots of output are included throughout the chapters.\n \nThis text is also available with MyStatLab™­—see the Features section or visit www.mystatlab.com for more information.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (488, '0321836510', '9780321836519', 'Statistics for Business: Decision Making and Analysis', 2014, 22, 5, 1, 2, '8-1/2\" x 10-7/8\"', '864', '2012-12-21 00:00:00', 'In Statistics for Business: Decision Making and Analysis, authors Robert Stine and Dean Foster of the University of Pennsylvania’s Wharton School, take a sophisticated approach to teaching statistics in the context of making good business decisions. The authors show students how to recognize and understand each business question, use statistical tools to do the analysis, and how to communicate their results clearly and concisely.\n \nIn addition to providing cases and real data to demonstrate real business situations, this text provides resources to support understanding and engagement. A successful problem-solving framework in the 4-M Examples (Motivation, Method, Mechanics, Message) model a clear outline for solving problems, new What Do You Think questions give students an opportunity to stop and check their understanding as they read, and new learning objectives guide students through each chapter and help them to review major goals. Software Hints provide instructions for using the most up-to-date technology packages. The Second Edition also includes expanded coverage and instruction of Excel® 2010 and the XLSTAT™ add-in.\n \nThe MyStatLab™ course management system includes increased exercise coverage with the Second Edition, along with 100% of the You Do It exercises and a library of 1,000 Conceptual Questions that require students to apply their statistical understanding to conceptual business scenarios. Business Insight Videos show students how statistical methods are used by real businesses, and new StatTalk Videos present statistical concepts through a series of fun, brief, real-world examples. Technology tutorial videos at the exercise level support software use.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (489, '032182623X', '9780321826237', 'Statistics for Business and Economics', 2014, 22, 5, 1, 2, '8-1/2\" x 10-7/8\"', '944', '2012-12-21 00:00:00', 'For a one- or two-semester course in business statistics.\n \nStatistics for Business and Economics, Twelfth Edition, meets today\'s business students with a balance of clarity and rigor, and applications incorporated from a diverse range of industries. This classic text covers a wide variety of data collection and analysis techniques with these goals in mind: developing statistical thinking, learning to assess the credibility and value of inferences made from data, and making informed business decisions.\n \nThe Twelfth Edition has been updated with real, current data in many of the exercises, examples, and applications. Exercises draw on actual business situations and recent economic events so that students can test their knowledge throughout the course. Statistics in Action case studies open each chapter with a recent, controversial, or high-profile business issue, motivating students to critically evaluate the findings and think through the statistical issues involved. A continued emphasis on ethics highlights the importance of ethical behavior in collecting, interpreting, and reporting on data.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (490, '0321836987', '9780321836984', 'Essential Statistics', 2014, 3, 5, 1, 3, '8-1/2\" x 10-7/8\"', '624', '2012-12-21 00:00:00', 'This book is ideal for a one-semester course in statistics, offering a streamlined presentation of Essential Statistics: Exploring the World through Data, by Gould and Ryan.\n \nWe live in a data-driven world, and this is a book about understanding and working with that data. In order to be informed citizens, authors Rob Gould and Colleen Ryan believe that learning statistics extends beyond the classroom to an essential life skill. They teach students of all math backgrounds how to think about data, how to reason using data, and how to make decisions based on data.\n \nWith a clear, unintimidating writing style and carefully chosen pedagogy, Essential Statistics: Exploring the World through Data makes data analysis accessible to all students. Guided Exercises support students by building their confidence as they learn to solve problems.  Snapshots summarize statistical procedures and concepts for convenient studying. While this text assumes the use of statistical software, formulas are presented as an aid to understanding the concepts rather than the focus of study. Check Your Tech features demonstrate how students will get the same numerical value by-hand as when using statistical software.\n \nThe robust ancillary package–including the authors’ teaching notes, instructor-to-instructor podcasts, lecture-ready PowerPoint® Slides, MyStatLab, and more-–helps any instructor to teach a modern course in statistics.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (492, '013608530X', '9780136085300', 'Internetworking with TCP/IP Volume One', 2014, 25, 3, 1, 2, '7\" x 9-1/4\"', '754', '2013-04-01 00:00:00', 'For junior to graduate-level courses in Computer Networks, Data Networks, Network Protocols, and Internetworking.\n\nThis best-selling, conceptual introduction to TCP/IP internetworking protocols interweaves a clear discussion of fundamentals with the latest technologies. Leading author Douglas Comer covers layering and shows how all protocols in the TCP/IP suite fit into the five-layer model.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (546, '0205235778', '9780205235773', 'The Curious Writer', 2014, 12, 4, 1, 2, '7-3/8\" x 9-1/8\"', '704', '2012-12-21 00:00:00', 'The Curious Writer, an assignment-oriented, all-in-one rhetoric-reader-handbook, stresses the connections between personal and academic writing.\n \nThe Curious Writer emphasizes inquiry as both a method of discovery and learning and a driving force behind the writing process. The book operates on the principle that writers who begin with questions, rather than answers, achieve better results in their work. It treats research, revision, and critical reading skills (of both texts and visuals) as organic components of every writing process. Each of the eight writing assignment chapters offers integrated coverage of these three key activities and also provides special attention digital tools for invention and research. Offering a unique, entertaining, and personal author voice, The Curious Writer is sure to grab students’ interest and motivate them to write.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (547, '020587665X', '9780205876655', 'The Curious Writer, Brief Edition', 2014, 12, 4, 1, 3, '7-3/8\" x 9-1/8\"', '640', '2012-12-21 00:00:00', 'The Curious Writer, an assignment-oriented writing guide, stresses the connections between personal and academic writing.\n \nThe Curious Writer emphasizes inquiry as both a method of discovery and learning and a driving force behind the writing process. The book operates on the principle that writers who begin with questions, rather than answers, achieve better results in their work. It treats research, revision, and critical reading skills (of both texts and visuals) as organic components of every writing process. Each of the eight writing assignment chapters offers integrated coverage of these three key activities and also provides special attention digital tools for invention and research. Offering a unique, entertaining, and personal author voice, The Curious Writer is sure to grab students’ interest and motivate them to write.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (548, '0205876641', '9780205876648', 'The Curious Writer, Concise Edition', 2014, 12, 4, 1, 3, '7-3/8\" x 9-1/8\"', '432', '2012-12-21 00:00:00', 'This Concise abbreviation of The Curious Writer offers an inquiry-driven approach, a focus on the connections between personal and academic writing, and a personal voice that engages and motivates students.\n \nThe Curious Writer emphasizes inquiry as both a method of discovery and learning and a driving force behind the writing process. The book operates on the principle that writers who begin with questions, rather than answers, achieve better results in their work. It treats research, revision, and critical reading skills (of both texts and visuals) as organic components of every writing process. Each of the eight writing assignment chapters offers integrated coverage of these three key activities and also provides special attention digital tools for invention and research. Offering a unique, entertaining, and personal author voice, The Curious Writer is sure to grab students’ interest and motivate them to write.\n \nIn just ten chapters, the Concise Edition encourages students to use writing as a tool of discovery while composing and revising their own reviews, proposals, and critical, personal, argumentative and research essays.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (549, '0321886518', '9780321886514', 'Complete Works of Shakespeare 7E', 2014, 13, 4, 1, 2, '8\" x 10\"', '2,016', '2012-12-29 00:00:00', 'A balanced editorial approach, a highly respected editor, and proven apparatus combine to make Bevington the most student-friendly introduction to Shakespeare on the market.\n \nThe seventh edition of this comprehensive anthology addresses the two key issues confronted by students approaching Shakespeare today:\n \n(1) a lack of knowledge about the historical period and;\n(2)  difficulty with the language of Shakespeare\'s plays.\n \nDavid Bevington\'s richly illustrated general introduction offers insight into Shakespeare\'s England and background on the literary, social, and cultural contexts in which Shakespeare wrote and produced plays. Each play is introduced by a descriptive essay designed to help students appreciate the historical contexts and interpretive issues raised by the play, without dictating students\' interpretations. Completely revised and updated notes and glosses support student readers line by line, paraphrasing Elizabethan expressions in clear and accessible contemporary language.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (550, '0321829174', '9780321829177', 'Literature for Composition', 2014, 13, 4, 1, 3, '6-3/8\" x 9-1/8\"', '1,576', '2013-01-02 00:00:00', 'The definitive book for literature for composition or introduction to literature courses-- Literature for Composition offers superior coverage of reading, writing, and arguing about literature in Barnet’s clear and accessible style along with an anthology organized around ten thought-provoking themes.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (551, '0205902278', '9780205902279', 'Literature and the Writing Process', 2014, 13, 4, 1, 3, '6-3/8\" x 9-1/8\"', '1,224', '2013-01-02 00:00:00', 'For Introductory Literature and Composition courses.\n \nLiterature and the Writing Process combines the best elements of a literature anthology with those of a handbook to guide students through the interrelated process of analytical reading and critical writing.\n \nThe authors of Literature and the Writing Process hold to one simple premise: great literature–always thought-provoking, always new–offers a valuable path to teaching both writing and critical thinking skills.  By seamlessly integrating literature and composition into one multi-purpose text, this approach serves the dual process of enabling students both to enjoy, understand, and learn from imaginative literature; and to write clearly, intelligently, and correctly about what they have learned.   Text writing assignments use literature as a tool of critical thought, a method for analysis, and a way of communicating ideas.  This approach emphasizes writing as the focus of the book with literature as the means to write effectively. \n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (552, '0205875548', '9780205875542', 'The Prentice Hall Guide for College Writers', 2014, 12, 4, 1, 2, '7-3/8\" x 9-1/8\"', '704', '2013-01-02 00:00:00', 'Focusing on purpose, situation, techniques, and processes in each self-contained chapter, The Prentice Hall Guide guides students step by step through their assignments.\n \nOrganized by writers’ purposes (to explain, to evaluate, to argue, etc.), The Prentice Hall Guide for College Writers foregrounds rhetorical awareness and asks students to consider their purpose, audience, and genre every time they write. In each “writing project” chapter, they are also walked through the process of inventing, researching, drafting, peer reviewing and revising. And in each project chapter, techniques and rhetorical modes particularly useful in accomplishing the writer’s purpose are suggested. This consistent and detailed guidance supports students throughout each of their major course projects and provides all instruction in one place so that they never need to flip between chapters. Its rhetorical emphasis, practical step-by-step approach, and usable structure make this guide highly teachable and a favorite of large writing programs for over 25 years.\n \nNew content for accelerated composition courses built on principles of mainstreaming and backward design offers scaffolded reading and writing support as well as just-in-time grammar remediation.\n ', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (553, '0205883052', '9780205883059', 'The Prentice Hall Guide for College Writers, Brief Edition', 2014, 12, 4, 1, 3, '7-3/8\" x 9-1/8\"', '656', '2013-01-02 00:00:00', 'Focusing on purpose, situation, techniques, and processes in each self-contained chapter, The Prentice Hall Guide guides students step by step through their assignments.\n \nOrganized by writers’ purposes (to explain, to evaluate, to argue, etc.), The Prentice Hall Guide for College Writers foregrounds rhetorical awareness and asks students to consider their purpose, audience, and genre every time they write. In each “writing project” chapter, they are also walked through the process of inventing, researching, drafting, peer reviewing and revising. And in each project chapter, techniques and rhetorical modes particularly useful in accomplishing the writer’s purpose are suggested. This consistent and detailed guidance supports students throughout each of their major course projects and provides all instruction in one place so that they never need to flip between chapters.\n \nIts rhetorical emphasis, practical step-by-step approach, and usable structure make this guide highly teachable and a favorite of large writing programs for over 25 years.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (554, '0205883117', '9780205883110', 'Strategies for Successful Writing', 2014, 12, 4, 1, 3, '7-3/8\" x 9-1/8\"', '704', '2013-01-02 00:00:00', 'Strategies for Successful Writing keeps instruction brief and to-the-point so that students spend less time reading about writing and more time writing. Instruction delivered through extensive examples helps students see what different strategies look like when applied in real texts.\n \nNew content for accelerated composition courses built on principles of mainstreaming and backward design offers scaffolded reading and writing support as well as just-in-time grammar remediation.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (555, '0205886159', '9780205886159', 'Global Issues, Local Arguments', 2014, 15, 4, 1, 3, '6\" x 9\"', '544', '2013-01-02 00:00:00', 'Global Issues, Local Arguments: Readings for Writing features high-interest arguments on significant global issues and emphasizes their connection to students’ lives–all the while developing critical thinking, rhetorical, analysis, synthesis, argumentation, and research skills.\n \nThe first argument reader of its kind, Global Issues, Local Arguments: Readings for Writing provides an introduction to analyzing and writing arguments and explores oppositional and nuanced points of view on issues pertaining to globalization: Free Trade, Immigration, Water Rights, Alternative Energy Resources, Culture, Social Media, Human Rights, and Global Pandemics.  Students are asked to make connections between local actions and global issues so that they start to understand how writing can be a tool for learning and an agent of change–relevant and effective both inside and outside of academe.\n \nConscientious, specific, and plentiful pedagogy introduces each issue, follows each reading, and concludes each chapter, continually asking students to break down and compare rhetorical argument strategies in use.  Thoughtful writing prompts build from brief, informal writing assignments toward more comprehensive and formal rhetorical analyses and researched arguments.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (556, '0205890962', '9780205890965', 'Mosaics: Reading and Writing Essays 6e', 2014, 20, 4, 1, 3, '7-3/8\" x 9-1/8\"', '816', '2013-01-02 00:00:00', 'Mosaics illustrates how thinking, reading, and writing are part of an interrelated process, and encourages students to discover how the “mosaics” of their own reading and writing processes work together to form a coherent whole.\n \nAcclaimed instructor and author Kim Flachmann capitalizes on the growing trend of studying reading to sharpen writing skills. Throughout the text, students are shown the interrelationship among thinking, reading, and writing as they move back and forth through the tasks of pre-reading and reading, prewriting and writing, and revising and editing.  Reading strategies are introduced in Chapter 1 and then integrated throughout the text.  Meanwhile, as they are employing these reading strategies, students learn from their own writing—revising and editing their own writing.\n \nThis edition of Mosaics: Reading and Writing Paragraphs is supported by an enhanced MyWritingLab course, which offers text-specific exercises within the Learning Path, all of which feed into the MyWritingLab Gradebook.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (557, '0321872568', '9780321872562', 'LB Brief with Tabs', 2014, 33, 4, 1, 3, '5-1/2\" x 8-1/2\"', '608', '2013-01-03 00:00:00', 'LB Brief offers the authority and currency of its best-selling parent, The Little, Brown Handbook, in a briefer, spiral-bound format with tabs at an affordable price.\nAs in its previous edition, LB Brief provides students of varying skills and interests with clear, reliable, and accessible explanations of handbook basics—the writing process, grammar and usage, and research writing. The Fourth Edition builds on the handbook’s usefulness with four main emphases: (1) reading and writing across the curriculum, including an expanded chapter on academic writing, showing students how to write in response to texts, and more coverage of argument, with information on how to handle opposing views and strengthen an ethical appeal; (2) research writing, including expanded discussions on how to find and evaluate print and Web sources, and a new research-paper-in-progress; (3) up-to-date documentation guidelines, including the most recent revisions to MLA and APA documentation styles, with numerous models of new media in each style and new annotated sample sources; (4) more writing process instruction, including a new student work-in-progress and new discussions of voice in writing.\nConcise and easy to use, LB Brief helps writing students find what they need and then use what they find.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (558, '0205883109', '9780205883103', 'Strategies for Successful Writing, Concise Edition', 2014, 12, 4, 1, 3, '7-3/8\" x 9-1/8\"', '496', '2013-01-03 00:00:00', 'Strategies for Successful Writing keeps instruction brief and to-the-point so that students spend less time reading about writing and more time writing. Instruction delivered through extensive examples helps students see what different strategies look like when applied in real texts.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (559, '0205901840', '9780205901845', 'The Blair Reader', 2014, 13, 4, 1, 3, '6\" x 9\"', '688', '2013-01-03 00:00:00', 'haracterized by breadth and balance, this top-selling thematic reader offers important voices that meet Kirszner and Mandell\'s exacting standards for teachability in the classroom.\n \nThis top-selling broad thematic reader offers 116 classic and contemporary selections addressing both current issues and the relevant ideas that frame them.  Focused apparatus for reading and writing leads students to critical insights and opportunities to add their voices to the public conversations on the important issues of our day.  In addition, \"Focus\" units of readings on specific topics related to the broad themes encourage critical thinking and writing from sources.   Features 104 works of non-fiction prose, nine poems, and three pieces of short fiction.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (560, '0205891500', '9780205891504', 'Prose Reader', 2014, 13, 4, 1, 3, '6\" x 9\"', '640', '2013-01-03 00:00:00', 'Organized by rhetorical patterns, The Prose Reader teaches effective writing through critical thinking and showcases high quality contemporary works by a diversity of authors.\n \nAbove all others, this rhetorical patterns reader provides a comprehensive grounding in critical thinking as the foundation for close reading and effective writing.  Just as important, by exposing students to interesting and insightful prose by a diversity of top writers, students are motivated to respond in writing and in class discussions.  A wealth of discussion questions and writing assignments for each selection and chapter lead students from literal understanding, to interpretation, to critical understanding and response.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (561, '0205863795', '9780205863792', 'The DK Handbook', 2014, 33, 4, 1, 3, '6-1/4\" x 7-1/2\"', '688', '2013-01-04 00:00:00', 'Transforming student and instructor expectations for textbooks, The DK Handbook presents information in newly accessible, scientifically tested, and student-friendly ways.\n \nNever before seen in the handbook market, The DK Handbook’s design is a true marriage of visual and textual content, in which each topic is presented in self-contained, two-page spreads for at-a-glance referencing. Explanations are concise and “chunked” to be more approachable and appealing for today’s readers, and accompanying visuals truly teach – making concepts and processes visible to students. The ground-breaking layout creates a consistent look and feel that helps students connect with the material, find information, and recognize solutions to writing problems they often don’t have names for.\n \nIn addition to the groundbreaking design, The DK Handbook provides the content that students need. With more attention to research—particularly online research—than other handbooks, DK gives students a solid foundation in information literacy. The handbook also presents grammar and documentation (MLA, APA, CMS and CSE) in new ways that makes the material more accessible, including unique “pattern pages” that help students grasp principles visually.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (562, '0205874126', '9780205874125', 'Sterling Stories', 2014, 19, 4, 1, 3, '6\" x 9\"', '208', '2013-01-08 00:00:00', 'Sterling Stories is a brief anthology of 12 short stories geared toward students reading at the most basic level.\nThe anthology was carefully designed to maximize students’ reading and writing abilities using a rich literature collection from a diverse collection of authors. The text begins with a sample lesson — introducing reading skills, note-taking, and literary terms —designed for the developmental learner. Each story contains pre-reading vocabulary exercises and questions, headnotes, a journal entry worksheet, comprehension quizzes, and writing prompts.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (563, '0321880943', '9780321880949', 'The Necessary Shakespeare', 2014, 13, 4, 1, 3, '8\" x 10\"', '1,142', '2013-01-09 00:00:00', 'Extracted from the best-selling Complete Works of Shakespeare, 7/e by David Bevington, The Necessary Shakespeare offers the most comprehensive scholarly apparatus, with the most often taught—necessary—of Shakespeare\'s work, creating a truly concise yet complete anthology.\n \nThe fourth edition of this anthology addresses the two key issues confronted by students approaching Shakespeare today:\n(1) a lack of knowledge about the historical period and;\n(2)  difficulty with the language of Shakespeare\'s plays.\n \n A richly illustrated general introduction offers insight into Shakespeare\'s England and background on the literary, social, and cultural contexts in which Shakespeare wrote and produced plays. Each play is introduced by a descriptive essay designed to help students appreciate the historical contexts and interpretive issues raised by the play, without dictating students’ interpretations. Completely revised and updated notes and glosses support student readers line by line, paraphrasing Elizabethan expressions in clear and accessible contemporary language.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (564, '0205578063', '9780205578061', 'Read to Achieve: Gateway to Academic Reading', 2014, 19, 4, 1, 3, '8\" x 10\"', '564', '2013-01-13 00:00:00', 'Engaged Readers are Active Readers!\n \nDavid Rothman and Jilani Warsi’s goals with Read to Achieve are to spur developmental readers to become active readers and engage them in academic reading by fostering intellectual inquiry through an exploration of contemporary themes related to popular academic disciplines. When a subject matter piques the student’s interest—when the readings are provocative and engaging, when the vocabulary is made accessible through a focus on discipline-specific terminology, and when students have the opportunity to become active readers through expressing their opinions on controversial topics within a discipline—then the sparks will fly.\n \nRead To Achieve is for Introductory Developmental Reading Courses and the organization is THEMATIC based on academic disciplines.  ELL tips throughout the text prove especially useful in environments with many English Language Learners.\n \nThis edition of Read to Achieve is supported by an enhanced MyReadingLab course, which offers text-specific exercises within the Learning Path, all of which feed into the MyReadingLab Gradebook.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (566, '0321865820', '9780321865823', 'Academic Reading', 2014, 19, 4, 1, 3, '7-3/8\" x 9-1/8\"', '448', '2013-01-14 00:00:00', '\nAcademic Reading: College Major and Career Applications focuses on developing essential reading skills while showing students how to adapt them to specific academic disciplines and career fields.\n \nKathleen McWhorter offers a unique, contextualized approach that focuses on academic reading skills and also motivates students towards a particular area of interest or field of study. Readers learn important comprehension, vocabulary, and critical thinking skills, as well as how to adapt these skills to study specific academic disciplines. While doing so, they also learn what each discipline involves and explore the available career paths. As an end result, Academic Reading teaches essential reading skills while opening up new academic and career possibilities.\n \nThis edition of Academic Reading is supported by an enhanced MyReadingLab course, which offers text-specific exercises within the Learning Path, all of which feed into the MyReadingLab Gradebook.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (567, '0321906365', '9780321906366', 'Writing and Reading Across the Curriculum, Brief Edition', 2014, 15, 4, 1, 3, '6\" x 9\"', '432', '2013-01-16 00:00:00', 'This brief version of the best-selling cross-curricular classic retains its hallmark coverage of source-based writing skills combined with five popular readings chapters.\n \nThis brief version represents a carefully chosen selection from the comprehensive version of the text, with five of nine readings chapters included in thoughtfully abridged formats. The abbreviated rhetoric section covers the skills of summary, critique, analysis, and synthesis, taking students step-by-step through the process of writing papers based on source material. Students then put these skills to practice on thematically-linked essays on provocative topics in the readings chapters. A stronger focus on argumentation prepares students for college-level assignments across the disciplines.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (568, '0321846621', '9780321846624', 'Reading Rhetorically', 2014, 12, 4, 1, 3, '6\" x 9\"', '200', '2013-01-17 00:00:00', 'Offering concise yet thorough treatment of academic reading and writing in college, Reading Rhetorically, 4th.ed., shows students how to analyze texts by recognizing rhetorical strategies and genre conventions, and how to incorporate other writers’ texts into their own research-based papers.\n \nFour important features of this text:\n1.    Its emphasis on academic writing as a process in which writers engage with other texts\n2.    Its emphasis on reading as an interactive process of composing meaning\n3.    Its treatment rhetorical analysis as both an academic genre that sharpens students\' reading acuity and as a tool for academic research\n4.    Its analytical framework for understanding and critiquing how visual texts interact with verbal texts\n \nThis brief rhetoric teaches students how to see texts positioned in a conversation with other texts, how to recognize a text\'s rhetorical aims and persuasive strategies, and how to analyze texts for both content and method.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (569, '0321844254', '9780321844255', 'Building College Vocabulary Strategies', 2014, 19, 4, 1, 3, '8-1/2\" x 10-7/8\"', '168', '2013-01-18 00:00:00', 'For Fundamentals of Reading and Vocabulary Development courses.\nBasic College Vocabulary approaches vocabulary development with a unique and proven systematic strategy called SSCD–See and Say the word, use Structural analysis, apply Context clues, and incorporate Dictionary knowledge. The text addresses the need for identifying learning styles and reinforces the system with techniques to develop a repertoire of memory steps to improve retention of information.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (570, '0321838939', '9780321838933', 'Basic College Vocabulary Strategies', 2014, 19, 4, 1, 3, '8-1/2\" x 10-7/8\"', '168', '2013-01-18 00:00:00', 'For Fundamentals of Reading and Vocabulary Development courses.\nBasic College Vocabulary approaches vocabulary development with a unique and proven systematic strategy called SSCD–See and Say the word, use Structural analysis, apply Context clues and incorporate Dictionary knowledge. The text addresses the need for identifying learning styles and reinforces the system with techniques to develop a repertoire of memory steps to improve retention of information.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (571, '0321898680', '9780321898685', 'Style: Lessons in Clarity and Grace 11E', 2014, 12, 4, 1, 3, '5-1/2\" x 8-1/2\"', '272', '2013-01-28 00:00:00', 'Engaging and direct, Style: Lessons in Clarity and Grace is the guidebook for anyone who wants to write well.\n \nWilliams\' and Bizup\'s clear, accessible style models the kind of writing that audiences–both in college and after–will admire. The principles offered here help writers understand what readers expect and encourage writers to revise to meet those expectations more effectively.   This book is all you need to understand the principles of effective writing.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (572, '0205890547', '9780205890545', 'Mosaics: Reading and Writing Paragraphs', 2014, 20, 4, 4, 3, '7-3/8\" x 9-1/8\"', '704', '2013-05-29 00:00:00', 'Mosaics illustrates how thinking, reading, and writing are part of an interrelated process, and encourages students to discover how the “mosaics” of their own reading and writing processes work together to form a coherent whole.\n \nAcclaimed instructor and author Kim Flachmann capitalizes on the growing trend of studying reading to sharpen writing skills. Throughout the text, students are shown the interrelationship among thinking, reading, and writing as they move back and forth through the tasks of pre-reading and reading, prewriting and writing, and revising and editing.  Reading strategies are introduced in Chapter 1 and then integrated throughout the text.  Meanwhile, as they are employing these reading strategies, students learn from their own writing—revising and editing their own writing.\n \nThis edition of Mosaics: Reading and Writing Paragraphs is supported by an enhanced MyWritingLab course, which offers text-specific exercises within the Learning Path, all of which feed into the MyWritingLab Gradebook.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (574, '0321899970', '9780321899972', 'Technical Communication', 2014, 12, 4, 4, 3, '7-3/8\" x 9-1/8\"', '752', '2013-07-15 00:00:00', 'Technical Communication offers complete coverage of technical communication, business communication, and professional writing in a user-friendly writing style. The topics move from basic foundational concepts, to chapters on research, visuals, style, document design, usability, and finally to specific documents (basic workplace correspondence to more complex documents, technologies, and oral presentations).  The appendix includes thorough coverage of MLA, APA, and CSE (Council of Science Editors) documentation styles, and a handbook of grammar, mechanics, and usage. All descriptions of and instructions for creating technical documents are accompanied by clear, annotated model documents.  In addition, graphic illustrations appear throughout the book to make abstract concepts easy to understand. Checklists and Projects provide plentiful opportunities to learn and reinforce chapter topics.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (583, '032180709X', '9780321807090', 'John E. Freund\'s Mathematical Statistics with Applications', 2014, 3, 5, 1, 2, '8\" x 10\"', '670', '2012-12-21 00:00:00', 'John E. Freund\'s Mathematical Statistics with Applications, Eighth Edition, provides a calculus-based introduction to the theory and application of statistics, based on comprehensive coverage that reflects the latest in statistical thinking, the teaching of statistics, and current practices.\n \nThis text is appropriate for a two-semester or three-quarter calculus-based course in Introduction to Mathematical Statistics. It can also be used for a single-semester course emphasizing probability, probability distributions and densities, sampling, and classical statistical inference.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (585, '0321833651', '9780321833655', 'College Algebra Essentials', 2014, 10, 5, 4, 2, '8-1/2\" x 11\"', '600', '2012-12-21 00:00:00', 'Bob Blitzer has inspired thousands of students with his engaging approach to mathematics, making this beloved series the #1 in the market. Blitzer draws on his unique background in mathematics and behavioral science to present the full scope of mathematics with vivid applications in real-life situations. Students stay engaged because Blitzer often uses pop-culture and up-to-date references to connect math to students’ lives, showing that their world is profoundly mathematical.\n \nWith the Fourth Edition, Blitzer takes student engagement to a whole new level. In addition to the multitude of exciting updates to the text and MyMathLab® course, new application-based MathTalk videos allow students to think about and understand the mathematical world in a fun, yet practical way. Assessment exercises allow instructors to assign the videos and check for understanding of the mathematical concepts presented.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (586, '0321729641', '9780321729644', 'College Algebra: An Early Functions Approach', 2014, 10, 5, 4, 2, '8-1/2\" x 11\"', '840', '2012-12-21 00:00:00', 'Bob Blitzer has inspired thousands of students with his engaging approach to mathematics, making this beloved series the #1 in the market. Blitzer draws on his unique background in mathematics and behavioral science to present the full scope of mathematics with vivid applications in real-life situations. Students stay engaged because Blitzer often uses pop-culture and up-to-date references to connect math to students’ lives, showing that their world is profoundly mathematical.\n \nWith the Third Edition, Blitzer takes student engagement to a whole new level. In addition to the multitude of exciting updates to the text and MyMathLab® course, new application-based MathTalk videos allow students to think about and understand the mathematical world in a fun, yet practical way. Assessment exercises allow instructors to assign the videos and check for understanding of the mathematical concepts presented.\n', 1);
