INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (588, '0321782283', '9780321782281', 'College Algebra', 2014, 10, 5, 4, 2, '8-1/2\" x 10-7/8\"', '800', '2012-12-21 00:00:00', 'Bob Blitzer has inspired thousands of students with his engaging approach to mathematics, making this beloved series the #1 in the market. Blitzer draws on his unique background in mathematics and behavioral science to present the full scope of mathematics with vivid applications in real-life situations. Students stay engaged because Blitzer often uses pop-culture and up-to-date references to connect math to students’ lives, showing that their world is profoundly mathematical.\n \nWith the Sixth Edition, Blitzer takes student engagement to a whole new level. In addition to the multitude of exciting updates to the text and MyMathLab® course, new application-based MathTalk videos allow students to think about and understand the mathematical world in a fun, yet practical way. Assessment exercises allow instructors to assign the videos and check for understanding of the mathematical concepts presented.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (589, '0321826132', '9780321826138', 'College Algebra with Modeling & Visualization', 2014, 10, 5, 1, 2, '8-1/2\" x 10-7/8\"', '900', '2012-12-21 00:00:00', 'By connecting applications, modeling, and visualization, Gary Rockswold motivates students to learn mathematics in the context of their experiences. In order to both learn and retain the material, students must see a connection between the concepts and their real lives. In this new edition, connections are taken to a new level with “See the Concept” features, where students make important connections through detailed visualizations that deepen understanding.\n \nRockswold is also known for presenting the concept of a function as a unifying theme, with an emphasis on the rule of four (verbal, graphical, numerical, and symbolic representations). A flexible approach allows instructors to strike their own balance of skills, rule of four, applications, modeling, and technology.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (590, '0132898357', '9780132898355', 'Mathematics for Business', 2014, 21, 5, 1, 3, '8-1/2\" x 10-7/8\"', '928', '2012-12-21 00:00:00', 'For courses in business mathematics at the freshman/sophomore levels.\n \nMathematics for Business provides practical, up-to-date coverage of the mathematical techniques students must master to succeed in business today. Covering more algebra than competing books, it looks at a range of topics such as payroll records, inflation and the time value of money, range and standard deviation and index numbers. Examples and problems relate to real world events and personal finance issues so material is relevant to students. This tenth edition is supported by MyMathLab, includes over 150 new problems, uses Apple as a case study illustration, and addresses the global financial crisis and personal debt.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (591, '0321825535', '9780321825537', 'Basic College Mathematics', 2014, 11, 5, 1, 3, '8-1/2\" x 10-7/8\"', '832', '2012-12-21 00:00:00', 'The Support You Need to Succeed…Even On the Go!\n \nThe Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors. With the new editions, the approachable writing and pedagogy, varied exercise sets, and robust ancillary resources have been updated.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (592, '0321845056', '9780321845054', 'Essential Math 4e', 2014, 11, 5, 1, 3, '8-1/2\" x 10-7/8\"', '464', '2012-12-21 00:00:00', 'The Support You Need to Succeed…Even On the Go!\n \nThe Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors. With the new editions, the approachable writing and pedagogy, varied exercise sets, and robust ancillary resources have been updated. A tightly integrated MyMathLab course, new Lial Video Library, and fresh, interactive PowerPoint slides meet the changing needs of today’s students and instructors…even on the go!', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (593, '0321845021', '9780321845023', 'Prealgebra  5e', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '864', '2012-12-21 00:00:00', 'The Support You Need to Succeed…Even On the Go!\n \nThe Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (594, '0321874226', '9780321874221', 'Elementary Algebra:  Concepts & Applications', 2014, 11, 5, 4, 2, '8-1/2\" x 10-7/8\"', '672', '2012-12-21 00:00:00', 'The Bittinger Concepts and Applications Program delivers proven pedagogy, guiding students from skills-based math to the concepts-oriented math required for college courses. The new editions support students with a tightly integrated MyMathLab course (access kit available separately), quality applications and exercises, and a new MyMathGuide workbook and video program (available separately).\n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience for both instructors and students, this program will:\nImprove Results: MyMathLab delivers proven results in helping students succeed and provides engaging experiences that personalize learning.\nTeach Conceptual Understanding: Proven pedagogy, robust exercise sets, and end—of-chapter material are all geared towards ensuring students grasp the concepts.\nGuide Students’ Learning: The new Bittinger video program and MyMathGuide work hand in hand to guide students to success.\n \n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (595, '0321848284', '9780321848284', 'Intermediate Algebra: Concepts & Applications', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '794', '2012-12-21 00:00:00', 'Objective: Skills to Concepts\n \nThe Bittinger Concepts and Applications Program delivers proven pedagogy, guiding students from skills-based math to the concepts-oriented math required for college courses. The new editions support students with a tightly integrated MyMathLab course (access kit available separately), quality applications and exercises, and a new MyMathGuide workbook and video program (available separately).\n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience for both instructors and students, this program will:\nImprove Results: MyMathLab delivers proven results in helping students succeed and provides engaging experiences that personalize learning.\nTeach Conceptual Understanding: Proven pedagogy, robust exercise sets, and end—of-chapter material are all geared towards ensuring students grasp the concepts.\nGuide Students’ Learning: The new Bittinger video program and MyMathGuide work hand in hand to guide students to success.\n ', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (596, '0321900472', '9780321900470', 'Precalculus: A Unit Circle Approach', 2014, 10, 5, 1, 2, '8-1/2\" x 10-7/8\"', '960', '2012-12-21 00:00:00', 'Ratti and McWaters wrote this series with the primary goal of preparing students to be successful in calculus. Having taught both calculus and precalculus, the authors saw firsthand where students would struggle, where they needed help making connections, and what material they needed in order to succeed in calculus. Their experience in the classroom shows in each chapter, where they emphasize conceptual development, real-life applications, and extensive exercises to encourage a deeper understanding. Precalculus: A Unit Circle Approach, Second Edition, offers the best of both worlds: rigorous topics and a friendly, “teacherly” tone.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (597, '0321870484', '9780321870483', 'Introductory Algebra 10', 2014, 11, 5, 1, 3, '8-1/2\" x 10-7/8\"', '784', '2012-12-21 00:00:00', 'The Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (598, '0321826035', '9780321826039', 'Introductory & Intermediate Algebra 3e', 2014, 11, 5, 1, 3, '9\" x 10-7/8\"', '978', '2012-12-21 00:00:00', 'The Akst/Bragg series’ success is built around clear and concise writing, a side-by-side “teach by example” approach, and integrated applications throughout that help students achieve conceptual understanding. The user-friendly design offers a distinctive side-by-side format that pairs examples and their solutions with corresponding practice exercises. Students understand from the very beginning that doing math is an essential part of learning it. Motivational, real-world applications demonstrate how integral mathematical understanding is to a variety of disciplines, careers, and everyday situations.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (599, '032174747X', '9780321747471', 'Analysis with an Introduction to Proof', 2014, 11, 5, 1, 2, '7-3/8\" x 9-1/8\"', '380', '2012-12-22 00:00:00', 'For courses in undergraduate Analysis and Transition to Advanced Mathematics.\n \nAnalysis with an Introduction to Proof, Fifth Edition helps fill in the groundwork students need to succeed in real analysis—often considered the most difficult course in the undergraduate curriculum. By introducing logic and emphasizing the structure and nature of the arguments used, this text helps students move carefully from computationally oriented courses to abstract mathematics with its emphasis on proofs. Clear expositions and examples, helpful practice problems, numerous drawings, and selected hints/answers make this text readable, student-oriented, and teacher- friendly.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (600, '0321817621', '9780321817624', 'Statistical Reasoning for Everyday Life', 2014, 3, 5, 1, 3, '8-1/2\" x 10-7/8\"', '600', '2012-12-28 00:00:00', 'Statistical Reasoning for Everyday Life, Fourth Edition, provides students with a clear understanding of statistical concepts and ideas so they can become better critical thinkers and decision makers, whether they decide to start a business, plan for their financial future, or just watch the news. The authors bring statistics to life by applying statistical concepts to the real world situations, taken from news sources, the internet, and individual experiences.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (603, '0321825276', '9780321825278', 'Intro Stats', 2014, 3, 5, 1, 2, '8-1/2\" x 10-7/8\"', '768', '2012-12-29 00:00:00', 'Richard De Veaux, Paul Velleman, and David Bock wrote Intro Stats with the goal that students and instructors have as much fun reading it as they did writing it. Maintaining a conversational, humorous, and informal writing style, this new edition engages students from the first page.\n \nThe authors focus on statistical thinking throughout the text and rely on technology for calculations. As a result, students can focus on developing their conceptual understanding. Innovative Think/Show/Tell examples give students a problem-solving framework and, more importantly, a way to think through any statistics problem and present their results.\n \nNew to the Fourth Edition is a streamlined presentation that keeps students focused on what’s most important, while including out helpful features. An updated organization divides chapters into sections, with specific learning objectives to keep students on track. A detailed table of contents assists with navigation through this new layout. Single-concept exercises complement the existing mid- to hard-level exercises for basic skill development.\n \nThis text is also available with MyStatLab™­—please see the Features section or visit www.mystatlab.com for more information.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (604, '0321838203', '9780321838209', 'Calculus and Its Applications Expanded Version', 2014, 9, 5, 1, 2, '8-1/2\" x 10-7/8\"', '984', '2012-12-31 00:00:00', 'This is an expanded version of Calculus and its Applications, Tenth Edition, by Bittinger, Ellenbogen, and Surgent. This edition adds coverage of trigonometric functions, differential equations, sequences and series, probability distributions, and matrices. \n \nCalculus and Its Applications has become a best-selling text because of its accessible presentation that anticipates student needs. The writing style is ideal for today’s students, providing intuitive explanations that build on students’ earlier mathematical experiences. Explanations are often coupled with figures to help students visualize new calculus concepts. Additionally, the text’s numerous and up-to-date applications from business, economics, life sciences, and social sciences help motivate students. Algebra diagnostic and review material is available for those who need to strengthen basic skills. Every aspect of this text is designed to motivate and help students to more readily understand and apply the mathematics.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (607, '0133083500', '9780133083507', 'Basic Technical Mathematics', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '796', '2013-01-02 00:00:00', 'For courses in Introductory Technical Math.  \n \nThis tried-and-true text from Allyn Washington preserves the author\'s highly regarded approach to technical math, while enhancing the integration of technology. Appropriate for a one- to two-semester course, BASIC TECHNICAL MATHEMATICS shows how algebra and trigonometry are used on the job. It addresses a vast number of technologies including aeronautics, construction, energy, environmental, electronics, computer design, automotive, fire science and more! Known for its exceptional problem sets and applied material, the book offers practice exercises, writing exercises, word problems, and practice tests. This edition features more technical applications, over 1300 new exercises, additional graphing calculator screens, and a robust MyMathLab online homework course.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (608, '0133116530', '9780133116533', 'Basic Technical Mathematics with Calculus', 2014, 9, 5, 1, 2, '8-1/2\" x 10-7/8\"', '1,192', '2013-01-02 00:00:00', 'For courses in Introductory Technical Math.\n \nThis tried-and-true text from Allyn Washington preserves the author\'s highly regarded approach to technical math, while enhancing the integration of technology. Appropriate for a two- to three- semester course, BASIC TECHNICAL MATHEMATICS WITH CALCULUS shows how algebra, trigonometry, and basic calculus are used on the job. It addresses a vast number of technical and pre-engineering fields, including computer design, electronics, solar energy, lasers fiber optics, and the environment. Known for its exceptional problem sets and applied material, the book offers practice exercises, writing exercises, word problems, and practice tests. This edition features more technical applications, over 2300 new exercises, additional graphing calculator screens, and a robust MyMathLab online homework course.', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (609, '0205850251', '9780205850259', 'Writing for Life: Paragraphs and Essays, 3E', 2014, 20, 5, 1, 3, '8-1/2\" x 10-7/8\"', '720', '2013-01-04 00:00:00', 'The revolutionary approach of D.J. Henry’s Writing for Life offers a visually rich, high-interest, and down-to-earth approach that reinforces the writing process while showing students how to take responsibility for their learning.\n \nWhile the areas-for-learning are often steadfast, today’s developing writers learn differently than learners from 10, 15, 20 years ago. The overwhelming majority of today’s learners—having been influenced by television, interacted with the Web, and watched video games—are products of an environment where information is presented and ideas are expressed principally through visuals. D.J. Henry recognized the differences between today’s learners and learners of yesteryear, and wrote Writing for Life from the ground up to address the thinking and learning processes occurring today.\n \nThe ground-breaking design of Writing for Life (developed in conjunction with Dorling Kindersley Publishers [DK]) makes writing, reading and thinking processes visible, and shows the processes rather than just telling students about them. Highly graphic layouts and unique visual pedagogy empower students to transfer the learning strategies they already use in interpreting the visual world to the task of writing. This visual approach—created specifically for today’s visually-oriented learners-is complemented by the student-centered learning strategy called “What’s the Point?” Not only does \"What\'s the Point?\" demonstrate real-world scenarios or applications of writing in context, but this directed thinking activity also prompts students to set a learning goal, call on prior knowledge, predict information, focus on structure, and generate details for each writing lesson. Thus, the visual approach and the “What\'s the Point?” theme of Writing for Life inspire student-centered learning and motivation by illustrating the power of writing in life.\n \nThis edition of Writing for Life: Paragraphs and Essays is supported by an enhanced MyWritingLab course, which offers text-specific exercises within the Learning Path, all of which feed into the MyWritingLab Gradebook.\n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (610, '0321860470', '9780321860477', 'Cornerstones for College Success', 2014, 33, 5, 1, 3, '8-1/2\" x 10-7/8\"', '416', '2013-01-04 00:00:00', 'For First Year Experience, Student Success, and Introduction to College courses.\n \nWritten specifically for students attending four year programs, Cornerstones for College Success addresses the needs and challenges of today\'s college students. \n \nCornerstones is known for its\' concrete and practical strategies that students can apply to all college classes, the world of work, and life in general, and addresses the \"why\" of learning and the power of positive change. Offers hallmark coverage of Bloom\'s taxonomy, SQ3R integration, Information and Financial literacy. Major defining topics include first generation students, adult learners, making successful transitions, and planning for success in the second year and beyond. The ancillary materials are designed to assist instructors in delivering a top-level student success course.\n \nTECHNOLOGY OFFERING: MyStudentSuccessLab is available upon request. It is an online solution designed to help students ‘Start strong, Finish stronger’ by building skills for ongoing personal and professional development. Go to http://mystudentsuccesslab.com/mssl3 for a Point and Click DEMO. \n', 1);
INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (611, '0321860594', '9780321860590', 'Cornerstones for Community College Success, 2/E', 2014, 33, 5, 4, 3, '8-1/2\" x 10-7/8\"', '384', '2013-01-04 00:00:00', 'For First Year Experience, Student Success, and Introduction to College courses.\n \nWritten specifically for students attending two year programs, Cornerstones for Community College Success addresses the needs and challenges of students in community and technical colleges. \n \nKnown for its concrete and practical strategies that students can apply to all college classes, the world of work, and life in general, it addresses the \"why\" of learning and the power of positive change. Offers hallmark coverage of Bloom\'s taxonomy, SQ3R integration, Information and Financial literacy. Major defining topics include first generation students, adult learners, making successful transitions, and planning for success in the second year and beyond. The ancillary materials are designed to assist instructors in delivering a top-level student success course.\n ', 1);
