INSERT INTO `Books` (`BookID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (613, '0133011208', '9780133011203', 'Business Math', 2014, 21, 5, 1, 3, '9\" x 11-7/8\"', '880', '2013-01-08 00:00:00', 'For courses in business mathematics, personal finance, or small business management.\n \nBusiness Math, Tenth Edition unlocks the world of math by showing how it is used in the business world. Written in a conversational style, the book covers essential topics such as banking, interest, insurance, taxes, depreciation, inventory, and financial statements. It carefully explains common business practices such as markup, markdown, and cash discounts—showing students how these tools work in small business or personal finance. Authors encourage self-starters from the beginning, with the review of basic math, annotated examples, stop and check exercises, skill builders and application exercises. This edition includes updated problem sets, new trends and laws, a revised financial statements chapter and the one-of-a-kind MyMathLab website.', 0);
